,37,59,18,1,11,13,1),(149,'{\"spanishLongDesc\":\"<p>A trav&eacute;s de esta cobertura podr&aacute;s acceder a cualquier especialista o centros adscrito al cuadro m&eacute;dico de Axa</p><ul style=\\\"list-style-type: disc;\\\"><li>Periodo pr<span style=\\\"font-family: Arial,Helvetica,sans-serif;\\\">omocional si cont</span>ratas con efecto 1 de Enero.</li><li>Se elimina los periodos de carencia</li><li>Se asumen las preexistencias excepto graves. (encontrar&aacute;s las exclusiones en el apartado &quot;Documentaci&oacute;n&quot;)</li><li>Dental incluido</li></ul><p>Fuera de estos periodos de contrataci&oacute;n, se deber&aacute; cumplimentar cuestionario de salud, sujeto a valoraci&oacute;n por parte de la compa&ntilde;&iacute;a.</p><p data-f-id=\\\"pbf\\\" style=\\\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\\\">Powered by <a href=\\\"https://www.froala.com/wysiwyg-editor?pb=1\\\" title=\\\"Froala Editor\\\">Froala Editor</a></p>\",\"id\":149,\"healthType\":\"Sin Copago\",\"contributionCompany\":\"0%\",\"monthsAvailability\":[true,true,true,true,true,true,true,true,true,true,true,true],\"collectiveId\":38,\"questionare\":\"yes\",\"typeOfQuestionare\":\"telephone\"}',38,65,1,1,12,1,1),(150,'{\"spanishLongDesc\":\"<p>A trav&eacute;s de esta cobertura podr&aacute;s acceder a cualquier especialista o centros adscrito al cuadro m&eacute;dico de Axa o a cualquier otro no adscrito y Axa te reembolsar&aacute; el 80% del coste de la factura.</p><ul style=\\\"list-style-type: disc;\\\"><li>Periodo pr<span style=\\\"font-family: Arial,Helvetica,sans-serif;\\\">omocional si cont</span>ratas con efecto 1 de Enero.</li><li>Se elimina los periodos de carencia</li><li>Se asumen las preexistencias excepto graves. (encontrar&aacute;s las exclusiones en el apartado &quot;Documentaci&oacute;n&quot;)</li><li>Dental incluido</li></ul><p>Fuera de estos periodos de contrataci&oacute;n, se deber&aacute; cumplimentar cuestionario de salu