INSERT INTO `CompanyMessage` VALUES (7,'És important que sàpigues que per finalitzar la teva contractació has d\'acceptar el condicionat de l\'email que rebràs un cop hagis punxat el botó de \"signar\" en aquesta plataforma / Es importante que sepas que para finalizar tu contratación debes aceptar el condicionado del email que recibirás una vez hayas pulsado el botón de \"firmar\" en esta plataforma.',NULL,NULL,'\"all\"','2020-12-31 00:00:00',5,'2019-07-11 09:18:16','2019-07-15 07:50:39'),(9,'Recorda que pots contractar en qualsevol moment els productes que desitgis, abans del dia 10 de cada mes, perquè tinguin efecte el dia 1 del mes següent /  Recuerda que puedes contratar en cualquier momento los productos que desees, antes del día 1 de Agoto, para que tengan efecto el día 1 de Septiembre. A partir del 2 de Agosto y hasta el 10 de Septiembre podrás contratar con efecto 1 de Octubre. ',NULL,NULL,'\"all\"','2019-12-31 00:00:00',5,'2019-07-12 11:15:55','2019-07-15 07:50:12'),(10,'Per qualsevol dubte o qüestió pots contactar amb CONFIDE mitjançant el següent correu electrònic: retribucionflexible@confide.es / Para cualquier duda o cuestión puedes contactar con CONFIDE a través del siguiente correo electrónico: retribucionflexible@confide.es',NULL,NULL,'\"all\"','2019-12-31 00:00:00',5,'2019-07-12 11:16:27','2019-07-15 07:49:30'),(11,'Benvingut al Pla de Retribució Flexible de la teva empresa. A l\'apartat Documentació trobaràs tota la informació relativa al Pla així com un Manual de funcionament de la plataforma informàtica / Bienvenido al Plan de Retribución Flexible de tu empresa. En el apartado Documentación encontrarás toda la información relativa al Plan así como un Manual de funcionamiento de la plataforma informática.',NULL,NULL,'\"all\"','2019-12-31 00:00:00',5,'2019-07-12 11:16:58','2019-07-15 07:48:59'),(13,'<p>It is <strong>important</strong> that you know that to finalize your contract you must accept the condition of the email you will receive once you h