CREATE TABLE `CompanyModality` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `order` int(11) DEFAULT NULL,
  `clientCode` varchar(512) DEFAULT NULL,
  `clientCodeExempt` varchar(255) DEFAULT NULL,
  `defaultPrice` float NOT NULL,
  `startDate` datetime DEFAULT NULL,
  `endDate` datetime NOT NULL,
  `alertDays` int(11) NOT NULL,
  `companyId` int(11) DEFAULT NULL,
  `modalityId` int(11) DEFAULT NULL,
  `productId` int(11) DEFAULT NULL,
  `providerId` int(11) DEFAULT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `productId` (`productId`),
  KEY `providerId` (`providerId`),
  KEY `modalityId` (`modalityId`),
  KEY `companyId` (`companyId`),
  CONSTRAINT `CompanyModality_ibfk_1` FOREIGN KEY (`modalityId`) REFERENCES `Modality` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `CompanyModality_ibfk_2` FOREIGN KEY (`companyId`) REFERENCES `Company` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `CompanyModality_ibfk_3` FOREIGN KEY (`productId`) REFERENCES `Product` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `CompanyModality_ibfk_4` FOREIGN KEY (`providerId`) REFERENCES `Provider` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=211 DEFAULT CHARSET=latin1;
