INSERT INTO `CompanyPersonalization` VALUES (4,'Arial',NULL,'#000000','Acepto que he leído y entiendo las condiciones.',5,'<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong>aaaa</strong></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><u>ass</u></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><img src=\"blob:http://salarioflexible.com:3000/d008e932-51e0-493b-a4e0-e59d714d13fe\" style=\"width: 300px;\" class=\"fr-fic fr-dib\"></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>CONFIDE CONSULTORIA S.L. es el Responsable del tratamiento de los datos personales del Usuario y le informa que estos datos ser&aacute;n tratados de conformidad con lo dispuesto en el Reglamento (UE) 2016/679 de 27 de abril de 2016 (GDPR), por lo que se le facilita la siguiente informaci&oacute;n del tratamiento:</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Fin del tratamiento:</span></strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>&nbsp;Por inter&eacute;s leg&iacute;timo del responsable: mantener una relaci&oacute;n comercial. Por consentimiento del interesado: el env&iacute;o de comunicaciones de productos o servicios.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Criterios de conservaci&oacute;n de los datos:</span></strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>&nbsp;se conservar&aacute;n mientras exista un inter&eacute;s mutuo para mantener el fin del tratamiento y cuando ya no sea necesario para tal fin, se suprimir&aacute;n con medidas de seguridad adecuadas para garantizar la seudonimizaci&oacute;n de los datos o la destrucci&oacute;n total de los mismos.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Comunicaci&oacute;n de los datos:</span></strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>&nbsp;No se comunicar&aacute;n los datos a terceros, salvo obligaci&oacute;n legal o informaci&oacute;n de contrataci&oacute;n de productos.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Derechos que asisten al Usuario:</span></strong></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>-Derecho a retirar el consentimiento en cualquier momento.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>-Derecho de acceso, rectificaci&oacute;n, portabilidad y supresi&oacute;n de sus datos y a la limitaci&oacute;n u oposici&oacute;n al su tratamiento.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>-Derecho a presentar una reclamaci&oacute;n ante la Autoridad de control (</span><a href=\"http://www.aepd.es/\" target=\"_blank\"><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#1155CC;\'>www.aepd.es</span></a><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>) si considera que el tratamiento no se ajusta a la normativa vigente.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Datos de contacto para ejercer sus derechos:</span></strong></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Direcci&oacute;n postal: CONFIDE CONSULTORIA S.L. C/ ARIBAU 200 - PL.3, 08036, BARCELONA</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>(Barcelona). Email:&nbsp;</span><a href=\"mailto:retribucionflexible@confide.es\" target=\"_blank\"><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#1155CC;\'>retribucionflexible@confide.es</span></a></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>2.CAR&Aacute;CTER OBLIGATORIO O FACULTATIVO DE LA INFORMACI&Oacute;N FACILITADA POR EL USUARIO</span></strong></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Los Usuarios, mediante la marcaci&oacute;n de las casillas correspondientes y entrada de datos en los campos, marcados con un asterisco (*) en el formulario de contacto o presentados en formularios de descarga, aceptan expresamente y de forma libre e inequ&iacute;voca, que sus datos son necesarios para atender su petici&oacute;n, por parte del prestador, siendo voluntaria la inclusi&oacute;n de datos en los campos restantes. El Usuario garantiza que los datos personales facilitados al RESPONSABLE son veraces y se hace responsable de comunicar cualquier modificaci&oacute;n de los mismos.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>El RESPONSABLE informa y garantiza expresamente a los usuarios que sus datos personales no ser&aacute;n cedidos en ning&uacute;n caso a terceros, y que siempre que realizara alg&uacute;n tipo de cesi&oacute;n de datos personales, se pedir&aacute; previamente el consentimiento expreso, informado e inequ&iacute;voco por parte los Usuarios. Todos los datos solicitados a trav&eacute;s del sitio web son obligatorios, ya que son necesarios para la prestaci&oacute;n de un servicio &oacute;ptimo al Usuario. En caso de que no sean facilitados todos los datos, no se garantiza que la informaci&oacute;n y servicios facilitados sean completamente ajustados a sus necesidades.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>3.MEDIDAS DE SEGURIDAD</span></strong></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>Que de conformidad con lo dispuesto en las normativas vigentes en protecci&oacute;n de datos personales, el RESPONSABLE est&aacute; cumpliendo con todas las disposiciones de las normativas GDPR para el tratamiento de los datos personales de su responsabilidad, y manifiestamente con los principios descritos en el art&iacute;culo 5 del GDPR, por los cuales son tratados de manera l&iacute;cita, leal y transparente en relaci&oacute;n con el interesado y adecuados, pertinentes y limitados a lo necesario en relaci&oacute;n con los fines para los que son tratados.</span></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>El RESPONSABLE garantiza que ha implementado pol&iacute;ticas t&eacute;cnicas y organizativas apropiadas para aplicar las medidas de seguridad que establecen el GDPR con el fin de proteger los derechos y libertades de los Usuarios y les ha comunicado la informaci&oacute;n adecuada para que puedan ejercerlos.</span></p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>',NULL,NULL,NULL,NULL,NULL),(5,'Arial',NULL,'#3f4a58',NULL,1,NULL,'#414e5d',NULL,NULL,NULL,NULL),(6,'Arial',NULL,'#000000','I accept that I´ve read and understood everything',8,'<p>CONSENTIMIENTO PARA EL TRATAMIENTO DE DATOS PERSONALES CONFIDE CONSULTORIA S.L. es el Responsable del tratamiento de los datos personales del Usuario y le informa que estos datos ser&aacute;n tratados de conformidad con lo dispuesto en el Reglamento (UE) 2016/679 de 27 de abril de 2016 (GDPR), por lo que se le facilita la siguiente informaci&oacute;n del tratamiento: Fin del tratamiento: Por inter&eacute;s leg&iacute;timo del responsable: mantener una relaci&oacute;n comercial. Por consentimiento del interesado: el env&iacute;o de comunicaciones de productos o servicios. Criterios de conservaci&oacute;n de los datos: se conservar&aacute;n mientras exista un inter&eacute;s mutuo para mantener el fin del tratamiento y cuando ya no sea necesario para tal fin, se suprimir&aacute;n con medidas de seguridad adecuadas para garantizar la seudonimizaci&oacute;n de los datos o la destrucci&oacute;n total de los mismos. Comunicaci&oacute;n de los datos: No se comunicar&aacute;n los datos a terceros, salvo obligaci&oacute;n legal o informaci&oacute;n de contrataci&oacute;n de productos. Derechos que asisten al Usuario: -Derecho a retirar el consentimiento en cualquier momento. -Derecho de acceso, rectificaci&oacute;n, portabilidad y supresi&oacute;n de sus datos y a la limitaci&oacute;n u oposici&oacute;n al su tratamiento. -Derecho a presentar una reclamaci&oacute;n ante la Autoridad de control (www.aepd.es) si considera que el tratamiento no se ajusta a la normativa vigente. Datos de contacto para ejercer sus derechos: Direcci&oacute;n postal: CONFIDE CONSULTORIA S.L. C/ ARIBAU 200 - PL.3, 08036, BARCELONA (Barcelona). Email: retribucionflexible@confide.es 2.CAR&Aacute;CTER OBLIGATORIO O FACULTATIVO DE LA INFORMACI&Oacute;N FACILITADA POR EL USUARIO Los Usuarios, mediante la marcaci&oacute;n de las casillas correspondientes y entrada de datos en los campos, marcados con un asterisco (*) en el formulario de contacto o presentados en formularios de descarga, aceptan expresamente y de forma libre e inequ&iacute;voca, que sus datos son necesarios para atender su petici&oacute;n, por parte del prestador, siendo voluntaria la inclusi&oacute;n de datos en los campos restantes. El Usuario garantiza que los datos personales facilitados al RESPONSABLE son veraces y se hace responsable de comunicar cualquier modificaci&oacute;n de los mismos. El RESPONSABLE informa y garantiza expresamente a los usuarios que sus datos personales no ser&aacute;n cedidos en ning&uacute;n caso a terceros, y que siempre que realizara alg&uacute;n tipo de cesi&oacute;n de datos personales, se pedir&aacute; previamente el consentimiento expreso, informado e inequ&iacute;voco por parte los Usuarios. Todos los datos solicitados a trav&eacute;s del sitio web son obligatorios, ya que son necesarios para la prestaci&oacute;n de un servicio &oacute;ptimo al Usuario. En caso de que no sean facilitados todos los datos, no se garantiza que la informaci&oacute;n y servicios facilitados sean completamente ajustados a sus necesidades. 3.MEDIDAS DE SEGURIDAD Que de conformidad con lo dispuesto en las normativas vigentes en protecci&oacute;n de datos personales, el RESPONSABLE est&aacute; cumpliendo con todas las disposiciones de las normativas GDPR para el tratamiento de los datos personales de su responsabilidad, y manifiestamente con los principios descritos en el art&iacute;culo 5 del GDPR, por los cuales son tratados de manera l&iacute;cita, leal y transparente en relaci&oacute;n con el interesado y adecuados, pertinentes y limitados a lo necesario en relaci&oacute;n con los fines para los que son tratados. El RESPONSABLE garantiza que ha implementado pol&iacute;ticas t&eacute;cnicas y organizativas apropiadas para aplicar las medidas de seguridad que establecen el GDPR con el fin de proteger los derechos y libertades de los Usuarios y les ha comunicado la informaci&oacute;n adecuada para que puedan ejercerlos. Para continuar usted debe aceptar que ha le&iacute;do y est&aacute; conforme con la cl&aacute;usula anterior.</p>','#000000',NULL,NULL,NULL,NULL),(7,'Arial',NULL,'#2d2f41',NULL,9,'<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><strong><span style=\'font-size:16px;font-family:\"Tahoma\",sans-serif;color:#222222;\'>CONSENTIMIENTO PARA EL TRATAMIENTO DE DATOS PERSONALES</span></strong></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:15px;font-family:\"Calibri\",sans-serif;background:white;\'><br></p><p style=\'margin-top:0cm;margin-right:0cm;margin-bo