icaci&oacute;n de los mismos. El RESPONSABLE informa y garantiza expresamente a los usuarios que sus datos personales no ser&aacute;n cedidos en ning&uacute;n caso a terceros, y que siempre que realizara alg&uacute;n tipo de cesi&oacute;n de datos personales, se pedir&aacute; previamente el consentimiento expreso, informado e inequ&iacute;voco por parte los Usuarios. Todos los datos solicitados a trav&eacute;s del sitio web son obligatorios, ya que son necesarios para la prestaci&oacute;n de un servicio &oacute;ptimo al Usuario. En caso de que no sean facilitados todos los datos, no se garantiza que la informaci&oacute;n y servicios facilitados sean completamente ajustados a sus necesidades. 3.MEDIDAS DE SEGURIDAD Que de conformidad con lo dispuesto en las normativas vigentes en protecci&oacute;n de datos personales, el RESPONSABLE est&aacute; cumpliendo con todas las disposiciones de las normativas GDPR para el tratamiento de los datos personales de su responsabilidad, y manifiestamente con los principios descritos en el art&iacute;culo 5 del GDPR, por los cuales son tratados de manera l&iacute;cita, leal y transparente en relaci&oacute;n con el interesado y adecuados, pertinentes y limitados a lo necesario en relaci&oacute;n con los fines para los que son tratados. El RESPONSABLE garantiza que ha implementado pol&iacute;ticas t&eacute;cnicas y organizativas apropiadas para aplicar las medidas de seguridad que establecen el GDPR con el fin de proteger los derechos y libertades de los Usuarios y les ha comunicado la informaci&oacute;n adecuada para que puedan ejercerlos. Para continuar usted debe aceptar que ha le&iacute;do y est&aacute; conforme con la cl&aacute;usula anterior.</p>','#d0021b',NULL,NULL,NULL,NULL),(16,'Univers',NULL,'#0d20e7','prueba',20,'<p>probando voy<i class=\"fa fa-address-book fr-deletable\">&nbsp;</i></p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a 