DROP TABLE IF EXISTS `Modality`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `Modality` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL,
  `name` varchar(100) NOT NULL,
  `esName` text,
  `caName` text,
  `color` varchar(15) DEFAULT NULL,
  `providerWebsite` varchar(512) DEFAULT NULL,
  `featuredImage` varchar(512) DEFAULT NULL,
  `logo` varchar(512) DEFAULT NULL,
  `label1` varchar(512) DEFAULT NULL,
  `label2` varchar(512) DEFAULT NULL,
  `label1File` varchar(512) DEFAULT NULL,
  `label2File` varchar(512) DEFAULT NULL,
  `desc` longtext,
  `longDesc` longtext,
  `spanishDesc` longtext,
  `spanishLongDesc` longtext,
  `catalanDesc` longtext,
  `catalanLongDesc` longtext,
  `activationsExporter` varchar(150) DEFAULT NULL,
  `refillsExporter` varchar(150) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1',
  `details` text,
  `parentId` int(11) DEFAULT NULL,
  `productId` int(11) DEFAULT NULL,
  `providerId` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `productId` (`productId`,`providerId`),
  KEY `providerId` (`providerId`),
  CONSTRAINT `Modality_ibfk_1` FOREIGN KEY (`productId`) REFERENCES `Product` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `Modality_ibfk_2` FOREIGN KEY (`providerId`) REFERENCES `Provider` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

