INSERT INTO `Modality` VALUES (1,0,'Axa Complet','Axa Complet','Axa Complet','#000000','https://axa.es','75a9e2e9-28f3-4c14-b6bb-5b8c4f0e0d0e.png','e30a6afe-5f8a-40f0-a2c9-a420fbf682ee.jpg',NULL,NULL,NULL,NULL,'descript','<p>englishhhhhhh</p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Contrata la póliza colectiva de empresa para obtener ventajas fiscales y económicas. \nPincha en el interrogante para obtener más información. ','<ul style=\"list-style-type: disc;\"><li>Periodo pr<span style=\"font-family: Arial,Helvetica,sans-serif;\">omocional si cont</span>ratas con efecto 1 de Septiembre.</li><li>Se elimina los periodos de carencia</li><li>Se asumen las preexistencias excepto graves. (encontrar&aacute;s las exclusiones en el apartado &quot;Documentaci&oacute;n&quot;)</li><li>Dental incluido</li></ul><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Contracta la pòlissa col·lectiva d\'empresa per obtenir avantatges fiscals i econòmiques.\nPunxa en l\'interrogant per obtenir més informació.','<ul style=\"list-style-type: disc;\"><li>Per&iacute;ode promocional si contractes amb efecte 1 de Septembre.</li><li>S&#39;elimina els per&iacute;odes de car&egrave;ncia.</li><li>S&#39; assumeixen les preexist&egrave;ncies excepte greus. (Trobar&agrave;s les exclusions en l&#39; apartat &quot;Documentaci&oacute;&quot;)</li><li>Dental incl&ograve;s</li></ul><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>',NULL,NULL,1,'{\"healthType\":\"Sin copago\"}',NULL,1,1),(2,0,'Transport Card','Tarjeta Transporte','Tarjeta Transport','#1b3156','https://www.edenred.es/ticket-transporte/','7755425f-a02f-474f-ad76-e2ff698817ae.jpg','0fbe5976-4ae0-41cf-8009-86adc8fad141.jpg',NULL,NULL,NULL,NULL,'Obtén tu tarjeta transporte para poder comprar títulos y bonos de transporte público del metro, cercanía, tranvía, autobús… y tendrás un ahorro fiscal.\nPincha en el interrogante para obtener más información.\n','<p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Obtén tu tarjeta transporte para poder comprar títulos y bonos de transporte público del metro, cercanía, tranvía, autobús… y tendrás un ahorro fiscal.\nPincha en el interrogante para obtener más información.\n','<pre data-placeholder=\"Traducción\" dir=\"ltr\"><span style=\"font-family: Arial,Helvetica,sans-serif;\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>El importe est&aacute; exento de IRPF hasta 1.500&euro; al a&ntilde;o con un tope de 136.36&euro; mensuales</span></pre><p><i class=\"fa fa-dot-circle-o fr-deletable\">&nbsp;</i>Consulta el saldo disponible en cualquier momento online a trav&eacute;s de la web del proveedor. Para acceder deber&aacute;s registrarte en la web</p><p><i class=\"fa fa-dot-circle-o fr-deletable\">&nbsp;</i>El proveedor entregar&aacute; una tarjeta recargable mensualmente con el importe que hayas indicado.</p><p><i class=\"fa fa-dot-circle-o fr-deletable\">&nbsp;</i>En caso de p&eacute;rdida, extrav&iacute;o deber&aacute;s solicitar la anulaci&oacute;n de la misma a trav&eacute;s de los tel&eacute;fonos 902 054 345.</p><p><i class=\"fa fa-dot-circle-o fr-deletable\">&nbsp;</i>Debes solicitar un duplicado de tu tarjeta, al email: retribucionflexible@confide.es</p><p><i class=\"fa fa-dot-circle-o fr-deletable\">&nbsp;</i>La reposici&oacute;n de una nueva tarjeta tiene un coste de 4&euro; que se descontar&aacute; de tu n&oacute;mina coincidiendo con el mes de la entrega.</p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Aconsegueix la teva targeta transport per poder comprar títols i bonus de transport públic de metro, rodalies, tramvia, autobús ... i tindràs un estalvi fiscal.\nPunxa en l\'interrogant per obtenir més informació.','<pre data-placeholder=\"Traducción\" dir=\"ltr\"><span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>L&#39;import est&agrave; exempt d&#39;IRPF fins a <strong>1.500 &euro; a l&#39;any amb un l&iacute;mit de 136.36 &euro; mensuals</strong> </span>\n<span style=\"font-family: Arial,Helvetica,sans-serif;\"><span lang=\"ca\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Consulta el saldo disponible en qualsevol moment l&iacute;nia a trav&eacute;s del web del prove&iuml;dor. </span><span lang=\"ca\" tabindex=\"0\">Per accedir haur&agrave;s de registrar-te a la web del prove&iuml;dor.</span>\n<span lang=\"ca\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>El prove&iuml;dor lliurar&agrave; una targeta recarregable mensualment amb l&#39;import que hagis indicat. </span>\n<span lang=\"ca\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>En cas de p&egrave;rdua, p&egrave;rdua haur&agrave;s de sol&middot;licitar l&#39;anul&middot;laci&oacute; de la mateixa a trav&eacute;s dels tel&egrave;fons <strong>902.054.345.</strong> </span>\n<span lang=\"ca\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Has sol&middot;licitar un duplicat de la targeta, a l&#39;email: <strong>retribucionflexible@confide.es </strong></span>\n</span><span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>La reposici&oacute; d&#39;una nova targeta t&eacute; un cost de <strong>4 &euro; </strong>que es descomptar&agrave; de la n&ograve;mina coincidint amb el mes del lliurament.</span></pre><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>',NULL,NULL,1,'null',NULL,2,2),(3,0,'Food card','Tarjeta comida','Tarjeta menjar',NULL,'https://www.edenred.es/ticket-restaurant/','82972f88-f00e-469a-b45c-c726293c08ef.png','f1f61ba3-1bb2-484e-9e93-212f4a7587e6.jpg',NULL,NULL,NULL,NULL,'aaaaaaaaaaaa\n','<p>dddddddddd</p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Paga tu menú diario con tu tarjeta comida y te ahorrarás el pago de impuestos por importe de 11€. \nPincha en el interrogante para obtener más información.\n','<ul><li>El importe exento de IRPF es de 11&euro; diarios por el n&uacute;mero de d&iacute;as laborables al a&ntilde;o.</li><li>Recibir&aacute;s una tarjeta nominativa que podr&aacute;s utilizar en cualquier restaurante que permita el pago con tarjeta.</li><li>La tarjeta ser&aacute; personal e intransferible.</li><li>En caso de p&eacute;rdida, extrav&iacute;o deber&aacute;s solicitar la anulaci&oacute;n de la misma a trav&eacute;s de los tel&eacute;fonos <strong>902 054 345</strong><strong>.</strong></li><li>Para solicitar un duplicado de tu tarjeta deber&aacute;s enviar un correo electr&oacute;nico a <strong>retribucionflexible@confide.es</strong></li></ul><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Paga el teu menú diari amb la targeta menjar i t\'estalviaràs el pagament d\'impostos per import de 11 €.\nPunxa en l\'interrogant per obtenir més informació.','<pre data-placeholder=\"Traducción\" dir=\"ltr\"><span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>L&#39;import exempt d&#39;IRPF &eacute;s d&#39;11 &euro; diaris pel nombre de dies laborables a l&#39;any. </span>\n<span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Rebr&agrave;s una targeta nominativa que podr&agrave;s utilitzar en qualsevol restaurant que permeti el pagament amb targeta. </span>\n<span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>La targeta ser&agrave; personal i intransferible. En cas de p&egrave;rdua haur&agrave;s de sol&middot;licitar l&#39;anul&middot;laci&oacute; de la mateixa trucant al tel&egrave;fon <strong>902.054.345</strong>.</span>\n<span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Per sol&middot;licitar un duplicat de la targeta haur&agrave;s d&#39;enviar un correu electr&ograve;nic a <strong>retribucionflexible@confide.es</strong></span></pre><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>',NULL,NULL,1,'null',NULL,3,2),(4,0,'Kindergarten','Guardería','Llar d\'infants',NULL,'https://www.edenred.es/ticket-guarderia/buscador-guarderias/','f23285a2-14e2-45dd-90bd-adf5be3775e1.PNG','1ee81747-1669-4a15-978c-e7142630e29c.jpg',NULL,NULL,NULL,NULL,'aaaaaaaaaaaaaaaaaa','<p>dddd</p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Paga tu guardería a través de tu empresa y te ahorrarás el IRPF del importe de la guardería. \nPincha en el interrogante para obtener más información.\n','<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;margin-bottom:.0001pt;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;\'>Contacta con tu guarder&iacute;a y pregunta si actualmente est&aacute;n afiliados a la red del proveedor de guarder&iacute;a. Si lo est&aacute;, ind&iacute;cales a partir de qu&eacute; mes recibir&aacute;n el pago directamente del proveedor.</span></p><p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;margin-bottom:.0001pt;\'><br></p><p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;margin-bottom:.0001pt;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;\'>Si tu guarder&iacute;a no est&aacute; afiliada, solicita la afiliaci&oacute;n a trav&eacute;s de la p&aacute;gina web del proveedor. Podr&aacute;s contratar el producto cuando tu guarder&iacute;a est&eacute; afiliada y hayas obtenido el c&oacute;digo de afiliaci&oacute;n correspondiente.</span></p><p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;margin-bottom:.0001pt;\'><br></p><p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;margin-bottom:.0001pt;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;\'>Consulta en el link si tu guarder&iacute;a est&aacute; afiliada y <strong><u>obt&eacute;n el c&oacute;digo de afiliaci&oacute;n antes de contratar</u></strong>. &nbsp;</span></p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>','Paga la teva llar d\'infants a través de la teva empresa i t\'estalviaràs l\'IRPF de l\'import de la guarderia.\nPunxa en l\'interrogant per obtenir més informació.','<pre data-placeholder=\"Traducción\" dir=\"ltr\"><span lang=\"ca\" style=\"font-family: Arial, Helvetica, sans-serif;\" tabindex=\"0\"><i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Contacta amb la teva llar d&acute;infants i pregunta si actualment estan afiliats a la xarxa del prove&iuml;dor . Si ho est&agrave;, indica&#39;ls a partir de quin mes rebran el pagament directament del prove&iuml;dor. \n\n<i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Si la teva llar d&acute;infants no est&agrave; afiliada, sol&middot;licita l&#39;afiliaci&oacute; mitjan&ccedil;ant la p&agrave;gina web del prove&iuml;dor. Podr&agrave;s contractar el producte quan el teva escola bressol estigui afiliada i hagis obtingut el codi d&#39;afiliaci&oacute; corresponent. \n\n<i class=\"fa fa-dot-circle-o fr-deletable\"> </i>Consulta al link  de sota si la teva llar d&acute;infatnts est&agrave; afiliada i obteniu el codi d&#39;afiliaci&oacute; abans de contractar.</span></pre><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>',NULL,NULL,1,'null',NULL,4,2),(5,0,'Training','Formación','Formació',NULL,NULL,'c13fe9fa-77cd-4c12-914a-8d19a910e7df.PNG','b439f90f-84c1-4ae2-9c89-073fafe69692.jpg',NULL,NULL,NULL,NULL,'sssssss','<p>aaaaaaaaaa</p><p data-f-id=\"pbf\" style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;