INSERT INTO `Product` VALUES (1,'Salud','Contrata la póliza colectiva de empresa para obtener ventajas fiscales y económicas. \nSe considera retribución en especie exenta de tributación, los seguros de enfermedad pagados por la empresa a entidades aseguradoras para la cobertura de enfermedad de sus empleados, cónyuge y descendientes, con el límite de hasta 500€ anuales por cada asegurado.\nLa inclusión de la pareja de hecho en la póliza será considerada como no exenta a efectos de tributación.\nSelecciona la compañía para consultar condiciones y primas.','Contracta la pòlissa col·lectiva d\'empresa per obtenir avantatges fiscals i econòmiques.Es considera retribució en espècie exempta de tributació, les assegurances de malaltia pagats per l\'empresa a entitats asseguradores per a la cobertura de malaltia dels seus empleats, cònjuge i descendents, amb el límit de fins a 500 € anuals per cada assegurat.La inclusió de la parella de fet en la pòlissa serà considerada com no exempta a l\'efecte de tributació.Selecciona la companyia per consultar condicions i primes.','Exent','health-insurance','Contract the collective company policy to obtain tax and economic advantages.\nRemuneration in kind exempt from taxation is considered to be sickness insurance paid by the company to insurance companies for the sickness coverage of its employees, spouse and descendants, with a limit of up to € 500 per year per insured.\nThe inclusion of domestic partners in the policy will be considered non-exempt purposes of taxation.\nSelect the company to check conditions and premiums.'),(2,'Transporte',NULL,NULL,'Exent','transport',NULL),(3,'Comida',NULL,NULL,'Exent','food',NULL),(4,'Guardería',NULL,NULL,'Exent','kindergarten',NULL),(5,'Formación',NULL,NULL,'Exent','formation',NULL),(6,'Renting',NULL,NULL,'Exent','renting',NULL),(7,'Seguro de vida',NULL,NULL,'Top','life-insurance',NULL),(8,'Ahorro',NULL,NULL,'Exent','saving-plan',NULL),(9,'Gimnasio',NULL,NULL,'Top','gym',NULL),(10,'Loteria',NULL,NULL,'Top','lottery',NULL),(11,'Maceta',NULL,NULL,'Exent','food',NULL);
